import {Component} from "react";
import * as React from "react";
import Header from "../../commons/header/Header";

import './MyProfilePage.css';
import MailIcon from './mail-icon.png';
import ProfileIcon from './profile-icon.png';


class MyProfilePage extends Component<any, any> {
    constructor(props: any) {
        super(props);
        this.state = {
            isEmailValid: true,
            inputName: "",
            inputEmail: "",
            imageBase64: "data:image/png;base64,",


        };
        this.onNameChange = this.onNameChange.bind(this);
        this.onEmailChange = this.onEmailChange.bind(this);
        this.onPictureChange = this.onPictureChange.bind(this);
    }

    public render() {
        const emailClass = this.state.isEmailValid ? "p-container-box" : "p-container-box p-box-invalid-mail";

        return (
            <div>
                <Header login="none" courses="none" students="none" catalog="none" myProfile="inline"/>
                <div>
                    <div className="p-settings">Settings</div>
                </div>
                <div className="p-container">
                    <div className="p-container-account">
                        <div className="p-account">ACCOUNT</div>
                        <img className="p-profile-picture" src={this.state.imageBase64}/>
                        <div>
                            <input
                                type="file"
                                id="file"
                                className="p-input-file"
                                accept="image/*"
                                onChange={this.onPictureChange}
                            />
                            <label htmlFor="file">change</label>
                        </div>
                    </div>
                    <div className="p-container-input">
                        <div className="p-container-info">Profesor</div>
                        <div className="p-container-box">
                            <img className="p-icon" src={ProfileIcon}/>
                            <input className="input" value={this.state.inputName} onChange={this.onNameChange}
                                   placeholder="Jessica Tuan"/>
                        </div>
                        <div className={emailClass}>
                            <img className="p-icon" src={MailIcon}/>
                            <input className="input" value={this.state.inputEmail} onChange={this.onEmailChange}
                                   placeholder="jessica.tuan@cs.ubbcluj.com"/>
                        </div>
                    </div>

                </div>
            </div>
        )
    }

    onPictureChange(e: any) {
        const reader = new FileReader();

        reader.readAsDataURL(e.target.files[0]);

        reader.onload = () => {
            this.setState({imageBase64: reader.result});

        }

    }

    onNameChange(e: any) {
        this.setState({inputName: e.target.value})
    }

    onEmailChange(e: any) {
        this.setState({
            inputEmail: e.target.value,
            isEmailValid: this.validateEmail(e.target.value)
        });
    }

    validateEmail(email: string) {
        const re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
        return re.test(String(email).toLowerCase());
    }
}

export default MyProfilePage;